import React, { useState } from 'react';
import './App.css';

interface Clip {
  filename: string;
  title: string;
  description: string;
  start_time: string;
  end_time: string;
}

function App() {
  const [ytLink, setYtLink] = useState('');
  const [loading, setLoading] = useState(false);
  const [status, setStatus] = useState('');
  const [clips, setClips] = useState<Clip[]>([]);
  const [numClips, setNumClips] = useState(3);
  const [clipDuration, setClipDuration] = useState(30);

  const handleAnalyze = async () => {
    if (!ytLink) {
      setStatus('Please enter a YouTube link');
      return;
    }

    setLoading(true);
    setStatus('Processing video...');
    setClips([]);

    try {
      const response = await fetch('http://localhost:5000/analyze', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({ 
          ytLink,
          numClips,
          clipDuration
        }),
      });

      const data = await response.json();

      if (response.ok) {
        setStatus('Clips created successfully!');
        setClips(data.clips || []);
      } else {
        setStatus(`Error: ${data.error}`);
      }
    } catch (error) {
      setStatus('Error connecting to server');
    } finally {
      setLoading(false);
    }
  };

  const downloadClip = (filename: string, title: string) => {
    const link = document.createElement('a');
    link.href = `http://localhost:5000/clips/${filename}`;
    link.download = `${title}.mp4`;
    document.body.appendChild(link);
    link.click();
    document.body.removeChild(link);
  };

  return (
    <div className="App" style={{ padding: 32, maxWidth: 1200, margin: '0 auto' }}>
      <h2>YouTube Video Clipper</h2>

      <div style={{ marginBottom: 24 }}>
        <input
          type="text"
          placeholder="Paste YouTube video link here"
          value={ytLink}
          onChange={e => setYtLink(e.target.value)}
          style={{ width: 400, padding: 8, fontSize: 16 }}
          disabled={loading}
        />
      </div>

      <div style={{ marginBottom: 24, display: 'flex', gap: 20, alignItems: 'center' }}>
        <div>
          <label style={{ display: 'block', marginBottom: 5 }}>Number of Clips:</label>
          <select 
            value={numClips} 
            onChange={e => setNumClips(Number(e.target.value))}
            disabled={loading}
            style={{ padding: 8, fontSize: 16 }}
          >
            <option value={1}>1 Clip</option>
            <option value={2}>2 Clips</option>
            <option value={3}>3 Clips</option>
            <option value={4}>4 Clips</option>
            <option value={5}>5 Clips</option>
          </select>
        </div>

        <div>
          <label style={{ display: 'block', marginBottom: 5 }}>Clip Duration:</label>
          <select 
            value={clipDuration} 
            onChange={e => setClipDuration(Number(e.target.value))}
            disabled={loading}
            style={{ padding: 8, fontSize: 16 }}
          >
            <option value={15}>15 seconds</option>
            <option value={30}>30 seconds</option>
            <option value={45}>45 seconds</option>
            <option value={60}>60 seconds</option>
          </select>
        </div>

        <button 
          onClick={handleAnalyze} 
          style={{ 
            padding: '12px 24px', 
            fontSize: 16,
            backgroundColor: loading ? '#ccc' : '#007bff',
            color: 'white',
            border: 'none',
            borderRadius: 4,
            cursor: loading ? 'not-allowed' : 'pointer',
            marginTop: 20
          }}
          disabled={loading}
        >
          {loading ? 'Creating Clips...' : 'Create Clips'}
        </button>
      </div>

      <div style={{ marginTop: 24, minHeight: 40 }}>
        {status && <p style={{ color: status.includes('Error') ? 'red' : 'green' }}>{status}</p>}
      </div>

      {clips.length > 0 && (
        <div style={{ marginTop: 32 }}>
          <h3>Your Clips ({clips.length})</h3>
          <div style={{ display: 'grid', gridTemplateColumns: 'repeat(auto-fit, minmax(300px, 1fr))', gap: 20 }}>
            {clips.map((clip, index) => (
              <div key={index} style={{ 
                border: '1px solid #ddd', 
                borderRadius: 8, 
                padding: 16,
                backgroundColor: '#f9f9f9'
              }}>
                <h4 style={{ margin: '0 0 8px 0', fontSize: 16 }}>{clip.title}</h4>
                <p style={{ margin: '0 0 12px 0', fontSize: 14, color: '#666' }}>
                  Duration: {clip.start_time} - {clip.end_time}
                </p>
                <p style={{ margin: '0 0 16px 0', fontSize: 14 }}>
                  {clip.description}
                </p>
                <div style={{ display: 'flex', gap: 10 }}>
                  <video 
                    controls 
                    style={{ width: '100%', maxHeight: 200, borderRadius: 4 }}
                    src={`http://localhost:5000/clips/${clip.filename}`}
                  />
                </div>
                <button
                  onClick={() => downloadClip(clip.filename, clip.title)}
                  style={{
                    marginTop: 12,
                    padding: '8px 16px',
                    backgroundColor: '#28a745',
                    color: 'white',
                    border: 'none',
                    borderRadius: 4,
                    cursor: 'pointer',
                    fontSize: 14
                  }}
                >
                  Download Clip
                </button>
              </div>
            ))}
          </div>
        </div>
      )}
    </div>
  );
}

export default App;
